@ExceptionHandler(value = { MethodArgumentNotValidException.class, HttpMessageNotReadableException.class })
public <T extends BindException> ResponseEntity<ExceptionMsg> handleValidationException(final T e) {
    log.info("**ApiExceptionHandler controller, handle validation exception*\n");
    final var badRequest = HttpStatus.BAD_REQUEST;
    return new ResponseEntity<>(ExceptionMsg.builder().msg("*" + e.getBindingResult().getFieldError().getDefaultMessage() + "!**").httpStatus(badRequest).timestamp(ZonedDateTime.now(ZoneId.systemDefault())).build(), badRequest);
}

@ExceptionHandler(value = { CategoryNotFoundException.class, ProductNotFoundException.class })
public <T extends RuntimeException> ResponseEntity<ExceptionMsg> handleApiRequestException(final T e) {
    log.info("**ApiExceptionHandler controller, handle API request*\n");
    final var badRequest = HttpStatus.BAD_REQUEST;
    return new ResponseEntity<>(ExceptionMsg.builder().msg("#### " + e.getMessage() + "! ####").httpStatus(badRequest).timestamp(ZonedDateTime.now(ZoneId.systemDefault())).build(), badRequest);
}

public static CategoryDto map(final Category category) {
    final var parentCategory = Optional.ofNullable(category.getParentCategory()).orElseGet(() -> new Category());
    return CategoryDto.builder().categoryId(category.getCategoryId()).categoryTitle(category.getCategoryTitle()).imageUrl(category.getImageUrl()).parentCategoryDto(CategoryDto.builder().categoryId(parentCategory.getCategoryId()).categoryTitle(parentCategory.getCategoryTitle()).imageUrl(parentCategory.getImageUrl()).build()).build();
}

public static Category map(final CategoryDto categoryDto) {
    final var parentCategoryDto = Optional.ofNullable(categoryDto.getParentCategoryDto()).orElseGet(() -> new CategoryDto());
    return Category.builder().categoryId(categoryDto.getCategoryId()).categoryTitle(categoryDto.getCategoryTitle()).imageUrl(categoryDto.getImageUrl()).parentCategory(Category.builder().categoryId(parentCategoryDto.getCategoryId()).categoryTitle(parentCategoryDto.getCategoryTitle()).imageUrl(parentCategoryDto.getImageUrl()).build()).build();
}

public static ProductDto map(final Product product) {
    return ProductDto.builder().productId(product.getProductId()).productTitle(product.getProductTitle()).imageUrl(product.getImageUrl()).sku(product.getSku()).priceUnit(product.getPriceUnit()).quantity(product.getQuantity()).categoryDto(CategoryDto.builder().categoryId(product.getCategory().getCategoryId()).categoryTitle(product.getCategory().getCategoryTitle()).imageUrl(product.getCategory().getImageUrl()).build()).build();
}

public static Product map(final ProductDto productDto) {
    return Product.builder().productId(productDto.getProductId()).productTitle(productDto.getProductTitle()).imageUrl(productDto.getImageUrl()).sku(productDto.getSku()).priceUnit(productDto.getPriceUnit()).quantity(productDto.getQuantity()).category(Category.builder().categoryId(productDto.getCategoryDto().getCategoryId()).categoryTitle(productDto.getCategoryDto().getCategoryTitle()).imageUrl(productDto.getCategoryDto().getImageUrl()).build()).build();
}

